import { useState, useEffect } from 'react';
import { DataTable } from 'primereact/datatable';
import { Column } from 'primereact/column';

export default function FullParameterList({ param_type }) {
    const [keyValuePairs, setKeyValuePairs] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        setLoading(true);

        if (param_type === 'full') {
            // Example data from params or your source
            const data = [
                {
                    "ACRO": {
                        "ACRO_BAL": {
                            "PITCH": 1,
                            "ROLL": 1
                        },
                        "ACRO_OPTIONS": 0,
                        "ACRO_RP": {
                            "EXPO": 0.3,
                            "RATE": 360,
                            "RATE_TC": 0
                        },
                        "ACRO_THR": {
                            "MID": 0
                        },
                        "ACRO_TRAINER": 2,
                        "ACRO_Y": {
                            "EXPO": 0,
                            "RATE": 202.5,
                            "RATE_TC": 0
                        }
                    },
                    // Add other parameters like "AHRS", "ARMING", etc.
                }
            ];

            const transformedData = transformData(data);
            setKeyValuePairs(transformedData);
            setLoading(false);
        } else {
            setKeyValuePairs([]);
            setLoading(false);
        }
    }, [param_type]);

    // Helper function to flatten the nested data structure
    const transformData = (data) => {
        const flattenedData = [];

        const flatten = (obj, parentKey = '') => {
            Object.keys(obj).forEach(key => {
                const newKey = parentKey ? `${parentKey}.${key}` : key;
                if (typeof obj[key] === 'object' && obj[key] !== null) {
                    flatten(obj[key], newKey); // Recursively flatten nested objects
                } else {
                    flattenedData.push({
                        key: newKey,
                        name: key,
                        category: parentKey,
                        value: obj[key]
                    });
                }
            });
        };

        data.forEach(item => flatten(item));

        return flattenedData;
    };

    return (
        <div className="card">
            {loading ? (
                <p>Loading data...</p>
            ) : keyValuePairs.length === 0 ? (
                <p>No data available.</p>
            ) : (
                <DataTable value={keyValuePairs} tableStyle={{ minWidth: '50rem' }} paginator rows={10}>
                    <Column field="key" header="Key"></Column>
                    <Column field="name" header="Name"></Column>
                    <Column field="category" header="Category"></Column>
                    <Column field="value" header="Value"></Column>
                </DataTable>
            )}
        </div>
    );
}
